import { withStyles } from '@material-ui/core/styles';
import { TableRow, TableCell, Button } from '@material-ui/core'
import SaveIcon from '@material-ui/icons/Save'
import CancelIcon from '@material-ui/icons/Cancel';
export const DarkTableRow = withStyles((theme) => ({
    root: {
        '&:nth-of-type(odd)': {
        backgroundColor: theme.palette.action.hover,
        },
    },
    }))(TableRow);
export const DarkTableCell = withStyles((theme) => ({
    head: {
        backgroundColor: theme.palette.common.black,
        color: theme.palette.common.white,
    },
    body: {
        fontSize: 14,
    },
    }))(TableCell);

export const ButtonSave = (text, clickEvent) => {
    return(
        <Button
        variant="contained"
        color="primary"
        size="large"
        onClick={clickEvent}
        startIcon={<SaveIcon />}
        >
        {text}
        </Button>
    )
};
export const ButtonCancel = (text, clickEvent) => {
    return(
        <Button
        variant="contained"
        color="secondary"
        size="large"
        onClick={clickEvent}
        startIcon={<CancelIcon />}
        >
        {text}
        </Button>
    )
};
export const ButtonAdd = (text, clickEvent) => {
    return(
        <Button
        variant="contained"
        color="secondary"
        size="large"
        onClick={clickEvent}
        startIcon={<CancelIcon />}
        >
        {text}
        </Button>
    )
};
